import React, { Component } from "react";
import NavComplete from "../components/navcomplete";
import Data from "../data/allarticles.json";
import ArticleSpread from "../components/articlespread";

class AllArticles extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div>
          <div
            style={{
              display: "grid",
              gridTemplateColumns: "repeat(auto-fit, minmax(100px, 400px))",
              gridTemplateRows: "repeat(auto-fit, 400px)",
              justifyContent: "center",
              gridGap: 100,
              marginTop: 100,
            }}
          >
            <div
              style={{
                display: "grid",
                justifyContent: "center",
                width: "80%",
                height: "80%",
                backgroundColor: "rgb(255, 203, 105)",
              }}
            ></div>
            <React.Fragment>
              {Data.content.map((counter) => (
                <div>
                  <ArticleSpread
                    key={counter.id}
                    title={counter.title}
                    content={counter.summary}
                    link={counter.link}
                  />
                </div>
              ))}
            </React.Fragment>
          </div>
        </div>
      </div>
    );
  }
}

export default AllArticles;
